import React, { useState } from 'react';
import {
  AppBar,
  Box,
  Container,
  Tabs,
  Tab,
  Toolbar,
  Typography,
  IconButton,
  useTheme,
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { OptionChainGrid } from './components/OptionChain/OptionChainGrid';
import { SpotChart } from './components/Charts/SpotChart';
import { DepthView } from './components/OrderBook/DepthView';
import { VolatilitySurface } from './components/Charts/VolatilitySurface';
import { OIChart } from './components/Charts/OIChart';

interface TabPanelProps {
  children?: React.ReactNode;
  index: number;
  value: number;
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`tabpanel-${index}`}
      aria-labelledby={`tab-${index}`}
      {...other}
      style={{ padding: '24px 0' }}
    >
      {value === index && <Box>{children}</Box>}
    </div>
  );
}

function App() {
  const [selectedTab, setSelectedTab] = useState(0);
  const theme = useTheme();

  const handleTabChange = (event: React.SyntheticEvent, newValue: number) => {
    setSelectedTab(newValue);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Kavas Capital
          </Typography>
        </Toolbar>
        <Tabs
          value={selectedTab}
          onChange={handleTabChange}
          aria-label="navigation tabs"
          sx={{ backgroundColor: theme.palette.background.paper }}
        >
          <Tab label="Option Chain" />
          <Tab label="Market Depth" />
          <Tab label="Charts" />
          <Tab label="Analytics" />
          <Tab label="Order Book" />
        </Tabs>
      </AppBar>

      <Container maxWidth="xl" sx={{ mt: 4, mb: 4 }}>
        <TabPanel value={selectedTab} index={0}>
          <OptionChainGrid symbol="NIFTY" />
        </TabPanel>
        <TabPanel value={selectedTab} index={1}>
          <DepthView depth={{ buys: [], sells: [] }} />
        </TabPanel>
        <TabPanel value={selectedTab} index={2}>
          <Box sx={{ display: 'grid', gap: 3, gridTemplateColumns: '1fr 1fr' }}>
            <SpotChart data={[]} title="Spot Price" />
            <OIChart data={[]} title="Open Interest" />
            <VolatilitySurface data={[]} />
          </Box>
        </TabPanel>
        <TabPanel value={selectedTab} index={3}>
          <Typography>Analytics Coming Soon</Typography>
        </TabPanel>
        <TabPanel value={selectedTab} index={4}>
          <Typography>Order Book Coming Soon</Typography>
        </TabPanel>
      </Container>
    </Box>
  );
}

export default App;
